import React from 'react'
import * as Style from './styles'

interface ButtonControl {
  img: any
  color: 'cyan' | 'green' | 'yellow'
  onClick?: any
}

const ButtonControl = ({ img, color }: ButtonControl) => {
  return (
    <Style.Container color={color} onClick={onClick}>
      <Style.Wrapper>
        <img src={img} alt="paper" />
      </Style.Wrapper>
    </Style.Container>
  )
}

export default ButtonControl
